def predictPartyVictory(senate: str) -> str:
    str_list = list(senate)

    num_r = str_list.count("R")
    num_d = str_list.count("D")

    i = 0
    while True:

        if i >= len(str_list):
            i = 0

        if str_list[i] == "R":
            if str_list[i::].count("D") > 0:
                str_list.pop(str_list[i::].index("D") + i)
            else:
                str_list.pop(str_list.index("D"))
        elif str_list[i] == "D":
            if str_list[i::].count("R") > 0:
                str_list.pop(str_list[i::].index("R") + i)
            else:
                str_list.pop(str_list.index("R"))
        i += 1

    if str_list[0] == "R":
        return "Radiant"
    elif str_list[0] == "D":
        return "Dire"


